import React, { useEffect, useState } from "react";
import {
  Container,
  Typography,
  Grid,
  TextField,
  Button,
  Card,
  CardContent,
  Divider
} from "@mui/material";

function Checkout() {
  const [cart, setCart] = useState([]);
  const [formData, setFormData] = useState({
    nombre: "",
    email: "",
    direccion: "",
    telefono: ""
  });

  // ðŸ“Œ Cargar carrito
  useEffect(() => {
    const savedCart = JSON.parse(localStorage.getItem("cart")) || [];
    setCart(savedCart);
  }, []);

  // ðŸ“Œ Calcular total
  const getTotal = () =>
    cart.reduce((acc, item) => acc + item.price * item.quantity, 0).toFixed(2);

  // ðŸ“Œ Manejar cambios en formulario
  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  // ðŸ“Œ Simular envÃ­o de pedido
  const handleSubmit = (e) => {
    e.preventDefault();

    if (!formData.nombre || !formData.email || !formData.direccion) {
      alert("Por favor, completa todos los campos obligatorios.");
      return;
    }

    alert(`âœ… Pedido realizado con Ã©xito\nGracias por tu compra, ${formData.nombre}`);
    localStorage.removeItem("cart"); // Vaciar carrito
    window.location.href = "/"; // Redirigir a inicio
  };

  if (cart.length === 0) {
    return (
      <Container sx={{ mt: 4, textAlign: "center" }}>
        <Typography variant="h5">ðŸ›’ No hay productos en tu carrito</Typography>
      </Container>
    );
  }

  return (
    <Container sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom>
        ðŸ§¾ Finalizar Compra
      </Typography>

      <Grid container spacing={4}>
        {/* Formulario */}
        <Grid item xs={12} md={6}>
          <Typography variant="h6" gutterBottom>
            Datos de envÃ­o
          </Typography>
          <form onSubmit={handleSubmit}>
            <TextField
              label="Nombre completo"
              name="nombre"
              value={formData.nombre}
              onChange={handleChange}
              fullWidth
              margin="normal"
              required
            />
            <TextField
              label="Correo electrÃ³nico"
              type="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
              fullWidth
              margin="normal"
              required
            />
            <TextField
              label="DirecciÃ³n"
              name="direccion"
              value={formData.direccion}
              onChange={handleChange}
              fullWidth
              margin="normal"
              required
            />
            <TextField
              label="TelÃ©fono"
              name="telefono"
              value={formData.telefono}
              onChange={handleChange}
              fullWidth
              margin="normal"
            />
            <Button
              type="submit"
              variant="contained"
              color="primary"
              fullWidth
              sx={{ mt: 2 }}
            >
              Realizar Pedido
            </Button>
          </form>
        </Grid>

        {/* Resumen */}
        <Grid item xs={12} md={6}>
          <Typography variant="h6" gutterBottom>
            Resumen de compra
          </Typography>
          <Card>
            <CardContent>
              {cart.map((item) => (
                <div key={item._id} style={{ marginBottom: "10px" }}>
                  <Typography variant="body1">
                    {item.name} x {item.quantity}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    S/ {(item.price * item.quantity).toFixed(2)}
                  </Typography>
                  <Divider sx={{ my: 1 }} />
                </div>
              ))}
              <Typography variant="h6" align="right">
                Total: S/ {getTotal()}
              </Typography>
            </CardContent>
          </Card>
        </Grid>
      </Grid>
    </Container>
  );
}

export default Checkout;
